- input: "TEXT\x1CC00011197\x1CTEXT-00001\x1C\x1CF3XA\x1CThis amendment is in response
    to the Commission's request, dated March 9, 2011.    1.  The contribution from
    AFSCME was believed to have been made with federal funds.  The Committee has now
    learned that this is not the case and is refunding this contribution.    2.  Two
    trasnactions that were originally recorded on Schedule F in support of Ben Chandler
    were misreported.  These have now been corrected to generic GOTV activity.  They
    did not reference a federal candidate.    3.  Summary page totals have now been
    corrected.    4.  Memo records on Schedule B, supporting Line 30(b) have now been
    properly attributed to a parent record.    5.  Transfers from the National Party
    Committees where kept in a segregated account and were not used to fund exempt
    activity.    6.  Expenditures on Schedule B, supporting Line 30(b) for Call Center
    and GOTV Phones were for genderic GOTV activity and did not mention a federal
    candidate.  Any payroll related expense on Schedule H4 was for the benefit of
    employees that did not spend over 25% of their compensated time on federal election
    activity. Any receipts on Schedule A, supporting LIne 17, for Voter File Access,
    were charged at the Usual and Normal Charge, previously established with the FEC.\n"
